import { faker } from '@faker-js/faker';
import userMode from '../model/user.model.js';
import blogModel from '../model/blog.model.js';

// Predefined tags for more realistic blog categorization
const blogTags = [
    'Technology', 'Programming', 'Web Development', 'Health', 'Fitness',
    'Food', 'Cooking', 'Travel', 'Adventure', 'Education', 'Science',
    'AI', 'Machine Learning', 'Data Science', 'Blockchain', 'Crypto',
    'Personal Finance', 'Investing', 'Productivity', 'Self Improvement',
    'Books', 'Reading', 'Writing', 'Art', 'Design', 'Photography',
    'Music', 'Movies', 'Gaming', 'Sports', 'Mindfulness', 'Mental Health'
];

// Generate rich blog content with paragraphs, headings, and base64 images
const generateRichContent = () => {

    let content = `<h1><img src="data:image/png;base64,"></h1><p><br></p><p><br></p><h2><span style="color: rgb(0, 0, 0);">Outgoing Madhya Pradesh judge Duppala Venkata Ramana said at his farewell function on Tuesday that his transfer to the Madhya Pradesh High Court was issued with ill intention to harass him, and that he was subjected to conspiratorial scrutiny because of which his family suffered in silence.</span></h2><h2><br></h2><h2><span style="color: rgb(0, 0, 0);">The Supreme Court collegium proposed transferring Justice Ramana of the High Court of Andhra Pradesh to the High Court of Madhya Pradesh in August 2023.</span></h2><h2><br></h2><h2><span style="color: rgb(0, 0, 0);">He requested his transfer proposal be reconsidered and sought a transfer to the High Court of Karnataka instead. The collegium did not find merit in his request and resolved to reiterate its recommendation to transfer him to the High Court of Madhya Pradesh as a permanent judge.</span></h2><p><br></p><p><br></p><h2><span style="color: rgb(0, 0, 0);">Ramana, who retired from the Indore bench of the MP High Court, said on Tuesday, I was transferred from Andhra Pradesh High Court to Madhya Pradesh High Court without any reason. I was asked for options. I opted for the state of Karnataka so that my wife gets better treatment but it was not considered by the Honourable Supreme Court.</span></h2><p><br></p><p><br></p><p><br></p><h2><span style="color: rgb(0, 0, 0);">Justice Ramana said that he sought the transfer on the ground of his wifes medical condition, since she suffered from paroxysmal non-epileptic seizures and infirmity in the brain due to the Covid pandemic. But the representation was neither considered nor rejected during the tenure of the then Chief Justices. I sent another representation; that too was neither rejected nor considered. I received no response. A judge like me expects positive humanitarian consideration. I was disheartened and deeply pained my transfer order seems to have been issued with ill intention to harass me, he said, adding, God does not forget nor forgive so easily.</span></h2><p><br></p>`;

    return content;
}

export const createUser = async (num) => {

    const users = [];

    for (let i = 0; i < num; i++) {
        users.push(userMode.create({
            name: faker.name.fullName(),
            email: faker.internet.email(),
            username: `@${faker.internet.userName().toLowerCase()}`,
            password: '123456',
            profileImage: {
                url: faker.image.avatar(),
                public_id: faker.string.uuid(),
            }
        }));
    }

    await Promise.all(users);
    console.log('Users created successfully');
    process.exit(0)
}

// create blogs 
export const createBlog = async (num) => {

    try {

        const blogs = [];

        // get all users ObjectId
        const users = await userMode.find().select('_id').lean().limit(100);

        users.forEach(user => {
            for (let i = 0; i < num; i++) {
                blogs.push(blogModel.create({
                    title: faker.lorem.sentence(20),
                    content: generateRichContent(),
                    tags: Array.from({ length: faker.number.int({ min: 1, max: 5 }) },
                        () => faker.helpers.arrayElement(blogTags)),
                    author: user,
                    bannerImage: {
                        url: faker.image.urlPicsumPhotos({ width: 640, height: 360 }),
                        public_id: faker.string.uuid(),
                    },
                    isPublished: false,
                }));
            }
        });

        await Promise.all(blogs);
        console.log('Blogs created successfully');
        process.exit(0);

    } catch (error) {
        console.log(error);
        process.exit(1);
    }
}

